//import logo from './logo.svg';
import 'bootstrap';
import './App.css';
 // eslint-disable-next-line
import ReactDOM from "react-dom";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <h1>Hello World</h1>
      </div>
    );
  }
}

export default App;
